import {
  IonCard,
  IonCardHeader,
  IonCardSubtitle,
  IonCardTitle,
} from "@ionic/react";
import React, { ReactComponentElement } from "react";

const Card: React.FC<{type: "agent" | "complex" | "package" | "promotion", id: string, title: string, subtitle: string, reference: string}> = (props) => {
    const id = props.id;
    const url = "/cardDetails/";
  return (
    <IonCard button={true} href={url.concat(props.title,"/",props.type,"/",props.reference)}>
      <IonCardHeader>
        <IonCardTitle>{props.title}</IonCardTitle>
        <IonCardSubtitle>{props.subtitle}</IonCardSubtitle>
      </IonCardHeader>
    </IonCard>
  );
};

export default Card;
